DECLARE @Temp TABLE(RM_APL_PGM_QUE VARCHAR(XX),UsefulDate DATE,RT_RUN_SRT_DTS_QUE VARCHAR(XX),RN_SEQ_LTR_CRT_QUE VARCHAR(XX),RN_SEQ_REC_QUE VARCHAR(XX),RM_DSC_LTR_QUE VARCHAR(XX),RI_PRV_RUN_ERR_QUE VARCHAR(XX),RF_SBJ_QUE VARCHAR(XX),RI_LTR_REQ_DEL_QUE VARCHAR(XX),RI_LTR_REQ_DEL_QUEX VARCHAR(XX))

SELECT T.* FROM 
	@Temp T 
	INNER JOIN CDW..LTXX_LTR_REQ_PRC LTXX
		ON LTXX.RM_APL_PGM_PRC = T.RM_APL_PGM_QUE
		AND CAST(LTXX.RT_RUN_SRT_DTS_PRC AS DATE) = T.UsefulDate
		AND LTXX.RN_SEQ_LTR_CRT_PRC = T.RN_SEQ_LTR_CRT_QUE
		AND LTXX.RN_SEQ_REC_PRC = T.RN_SEQ_REC_QUE
		AND LTXX.RM_DSC_LTR_PRC = T.RM_DSC_LTR_QUE
		AND LTXX.RI_PRV_RUN_ERR_PRC = T.RI_PRV_RUN_ERR_QUE
		AND LTXX.RF_SBJ_PRC = T.RF_SBJ_QUE
WHERE
	LTXX.PrintedAt IS NOT NULL
	OR LTXX.EcorrDocumentCreatedAt IS NOT NULL